import "./App.css";
import "./bulma/css/bulma.min.css";
import logo from "./images/logo.svg";
import heroJM from "./images/confidence.jpeg";
import NavBar from "./components/NavBar";
//import NavBar from './components/NavBar';
//import btn_primary from './components/CustomBtn';

const App = () => {
  return (
    <div>
      <div>
        <header>
          {NavBar}
          <div>
            <section class="hero">
              <div class="hero-body" backgroundImage={heroJM}>
                <p className="HeadingMain">Live with Confidence</p>
                <p class="TextRegular20">
                  Jos√© Mourinho brings confidence to pan-African Sanlam campaign
                </p>
                <button class="button" className="btn_jm">
                  <span>View Project</span>
                </button>
              </div>
            </section>
          </div>
        </header>
        <body>
          <div class="column">
            <div className="Rectangle"></div>
            <p className="font_WhatWeDo1">What We Do</p>
            <p className="font_WhatWeDo">
              We offer a complete range of bespoke design and development
              services to help you turn your ideas into digital masterpieces
            </p>
          </div>
        </body>
        <footer></footer>
      </div>
    </div>
  );
};

export default App;
